import React from "react";
import OtherHalfWindowTopImage from './res/otherhalfwindowtop.jpg';
import './Tile.css'

const OtherHalfWindowTop = () => {
    return (
        <img className="myTileImg" src={OtherHalfWindowTopImage}/>
    )
};

export default OtherHalfWindowTop;
